import{_ as t,c as o,o as n,ah as r}from"./chunks/framework.PvdZnrZd.js";const c=JSON.parse('{"title":"FEDEX SHIPPING","description":"FEDEX SHIPPING","frontmatter":{"title":"FEDEX SHIPPING","description":"FEDEX SHIPPING","date":"2025-07-18T00:00:00.000Z","author":"Chirag Tyagi"},"headers":[],"relativePath":"zenith/featured-app/shipping/fedex-shipping.md","filePath":"zenith/featured-app/shipping/fedex-shipping.md"}'),s={name:"zenith/featured-app/shipping/fedex-shipping.md"};function a(p,e,i,l,g,h){return n(),o("div",null,[...e[0]||(e[0]=[r('<p><a href="/zenith/introduction/">Multi-Vendor Marketplace for Shopify</a> is here with another marketplace shipping feature app, i.e., <strong>FedEx</strong>.</p><h2 id="fedex" tabindex="-1">FedEx <a class="header-anchor" href="#fedex" aria-label="Permalink to &quot;FedEx&quot;">​</a></h2><p><a href="https://www.fedex.com/en-us/home.html" target="_blank" rel="noreferrer">FedEx</a> Corporation is an American multinational courier delivery service.</p><p>Using this featured app, the merchants can enable shipment through <strong>FedEx</strong>. Moreover, he can allow <strong>US</strong> <strong>sellers</strong> to automatically generate shipping labels.</p><p><strong>FedEx</strong> feature app is available only with the Multivendor <strong>Pro</strong> <strong>Plan</strong> ($60/month). Moreover, you need to enable the <a href="/zenith/featured-app/overview.html"><strong>Shipping</strong></a> add-on (free) from the &#39;featured apps&#39; section of the app.</p><p><strong>CHARGES:</strong></p><p>This feature will have an additional charge of <strong>USD 10 per month</strong> over &amp; above your current multivendor marketplace plan.</p><p><strong>NOTE:</strong></p><p>Above all, access to Shipping requires your Shopify store to be on the plan that supports <strong>Real-Time Carrier-Calculated Shipping</strong>.</p><p>Currently, the FedEx Shipping feature app will only work for <strong>US Merchants</strong>.</p><p>FEDEX SHIPPING IS BOTH FOR <strong>RATE CALCULATION &amp; FULFILLMENT</strong></p><h2 id="installation" tabindex="-1">Installation <a class="header-anchor" href="#installation" aria-label="Permalink to &quot;Installation&quot;">​</a></h2><p>The admin needs to visit the <strong>multi-vendor marketplace admin panel</strong> &gt; click on the <strong>three dots</strong> &gt; click on the <strong>featured apps</strong>. Further, <strong>enable</strong> the <strong>FedEx</strong> feature app.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/fedex.webp" alt="image-13"></p><p>Furthermore, <strong>agree</strong> &amp; <strong>approve</strong> the charges:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Approve-fees-Shopify-2.png" alt="123"></p><p>Shopify Backend (Admin End)</p><h2 id="configuration-admin-end" tabindex="-1">Configuration: Admin End <a class="header-anchor" href="#configuration-admin-end" aria-label="Permalink to &quot;Configuration: Admin End&quot;">​</a></h2><p>Firstly, the admin needs to enable this shipping method from the shipping configuration. So, for this, visit:</p><p><strong>Multivendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping configuration</strong>.</p><p>Click on the <strong>three dots</strong> under the <strong>Action</strong> menu &amp; further, click on <strong>enable</strong>.</p><p><strong>Note</strong>: Kindly choose only those shipping services which you need. Don’t keep all the services selected otherwise it creates delay to retrieve shipping rates at the storefront.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/enablefedex.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><p>Moving on, the admin needs to configure the FedEx Shipping. So, for this, either click on <strong>Configure Shipping</strong> or go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>FedEx Shipping Configuration</strong>. Refer:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/openfedexconfig.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><h2 id="configure-fedex-express" tabindex="-1">Configure FedEx Express <a class="header-anchor" href="#configure-fedex-express" aria-label="Permalink to &quot;Configure FedEx Express&quot;">​</a></h2><p><strong>SANDBOX MODE</strong></p><p>If you want to test the functionality of this shipping add-on, enable the sandbox mode. In short, use the sandbox mode for testing purposes only.</p><p>Enter the following details: <strong>FEDEX ACCOUNT NUMBER</strong>, <strong>FEDEX ACCESS KEY</strong>, <strong>FEDEX PASSWORD</strong> &amp; <strong>FEDEX METER NUMBER</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/fedexconfigone.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><p>Further, choose the shipping service name for order fulfillment and Choose who will bear the shipping label charges, thus, the admin or the seller. (This is an extra cost apart from what the customer has paid.)</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/fedexconfigtwo.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><h2 id="set-shipping-method-for-sellers" tabindex="-1">Set Shipping Method For Sellers: <a class="header-anchor" href="#set-shipping-method-for-sellers" aria-label="Permalink to &quot;Set Shipping Method For Sellers:&quot;">​</a></h2><p>The admin can further set the shipping methods for his sellers.<br> Go to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>Sellers</strong> &gt; <strong>Seller Listing</strong> &gt; <strong>Edit</strong> (under <strong>Action</strong>). <br> On the edit seller page, the admin will have the following block from where he can enable/disable/set as default:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/methodforsellers.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><p>Further, the admin can view all the sellers which are using this shipping method by going to <strong>multi vendor marketplace admin panel</strong> &gt; <strong>configuration</strong> &gt; <strong>Shipping</strong> <strong>Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/viewsellers.webp" alt="123"></p><p>MultiVendor Marketplace Admin End</p><h2 id="make-shipping-address-phone-number-mandatory" tabindex="-1">Make <strong>Shipping</strong> <strong>Address Phone Number</strong> Mandatory <a class="header-anchor" href="#make-shipping-address-phone-number-mandatory" aria-label="Permalink to &quot;Make **Shipping** **Address Phone Number** Mandatory&quot;">​</a></h2><p>To use this feature add-on, the admin needs to make the <strong>Shipping</strong> <strong>address phone number mandatory</strong> at the time of <strong>checkout</strong>.</p><p>So, to do this, go to <strong>Shopify Backend</strong> &gt; <strong>Settings</strong> &gt; <strong>Checkout</strong> &gt; Under <strong>Form Options</strong>, make <strong>Shipping</strong> <strong>address phone number</strong> as <strong>Required</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/demo-store-Checkout-Shopify-1200x597.png" alt="133"></p><p>Shopify Backend (Admin End)</p><h2 id="configuration-seller-end" tabindex="-1">Configuration: Seller End <a class="header-anchor" href="#configuration-seller-end" aria-label="Permalink to &quot;Configuration: Seller End&quot;">​</a></h2><p>Further, the seller can configuration FedEx Shipping from his panel.</p><p>Go to <strong>multi vendor marketplace seller panel</strong> &gt; <strong>configuration</strong> &gt; <strong>shipping configuration</strong>&gt; <strong>enable</strong> the shipping:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/fedexenableseller.webp" alt="123"></p><p>MultiVendor Marketplace Seller End</p><p>Further, go to <strong>Global Configuration</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/globalconfig.webp" alt="123"></p><p>MultiVendor Marketplace Seller End</p><p>So, from here, the seller can do the <strong>SHIPPING PACKET CONFIGURATION</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/globalconfigseller.webp" alt="123"></p><p>MultiVendor Marketplace Seller End</p><p><strong>Note: LBH</strong> &gt; 1 inch (2.54 cm)</p><p>Moreover, the <strong>FEDEX SHIPPING CONFIGURATION</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/fedexconfigseller.webp" alt="123"></p><p>MultiVendor Marketplace Seller End</p><p>The seller can set the shipping method as <strong>by-default</strong> so that every single product created by him will have <strong>FedEx Shipping</strong> as the <strong>by-default shipping method</strong>.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-Configuration-Seller-%E2%80%A2-Multivendor-MarketPlace-2-2.png" alt="123"></p><p>MultiVendor Marketplace Seller End</p><p>If not this, the seller can set the shipping method on individual products while adding/editing them.</p><p>So, go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Products</strong> &gt;<strong>Product Listing</strong> &gt; <strong>Add</strong>/<strong>Edit</strong> the Product:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot-from-2019-09-17-12-42-45.png" alt="123"></p><p>MultiVendor Marketplace Seller End</p><h2 id="shopify-store-frontend" tabindex="-1">Shopify Store Frontend <a class="header-anchor" href="#shopify-store-frontend" aria-label="Permalink to &quot;Shopify Store Frontend&quot;">​</a></h2><p>Likewise, the customer will have an option to select the shipping method as <strong>FedEx</strong> after entering the information:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Shipping-demo-store-Checkout-1.png" alt="123"></p><h2 id="shipping-label-generation" tabindex="-1">Shipping Label Generation <a class="header-anchor" href="#shipping-label-generation" aria-label="Permalink to &quot;Shipping Label Generation&quot;">​</a></h2><p>Seller will have an option to generate a shipping label from their seller panel. Also, shipping labels can only be generated for <strong>fulfilled orders</strong>.</p><p><strong>Fulfilling order by FedEx</strong>:</p><p>Go to <strong>Multi-vendor marketplace seller panel</strong> &gt; <strong>Orders</strong> &gt; <strong>Order Listing</strong> &gt; <strong>View</strong> (under <strong>Action</strong>). Select the method of order fulfillment as <strong>FedEx</strong> and fulfill the order. As soon as the order will be fulfilled, the shipping label will be automatically downloaded.</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/orderfullpage.webp" alt="123"></p><p>Click on fulfill</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-2.png" alt="123"></p><p>Agree &amp; Fulfill: This block will have the information regarding who is bearing the shipping label charges.</p><p>Moreover, if you again want to download the shipping label, go to ADDITIONAL ORDER DETAILS, click on <strong>Actions</strong> &gt; <strong>Print Shipping Label</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2025/11/generateshiipinglabel.webp" alt="212"></p><p>Furthermore, this is how the shipping label will be downloaded in pdf form:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Screenshot-from-2019-09-17-14-31-53-1.png" alt="123"></p><h2 id="create-a-pickup-request" tabindex="-1">Create a Pickup Request <a class="header-anchor" href="#create-a-pickup-request" aria-label="Permalink to &quot;Create a Pickup Request&quot;">​</a></h2><p>The seller can generate a pickup request for the FedEx courier services to pick the order from your warehouse:</p><p>For this, go to ADDITIONAL ORDER DETAILS, click on <strong>Actions</strong> &gt; <strong>Create Pickup Request</strong>:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-4.png" alt="123"></p><p>This action will give you a pop-up:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-5.png" alt="123"></p><p>Enter the required details &amp; save.</p><p>Further, the seller can view the generated pickup request on the same page under PICKUP REQUEST DETAILS section:</p><p><img src="https://cdnblog.webkul.com/blog/wp-content/uploads/2019/09/Order-Details-Seller-%E2%80%A2-Multivendor-MarketPlace-6.png" alt="123"></p><p>The seller can view the pickup request details &amp; also, can cancel the request.</p><p><strong>NOTE:</strong></p><p>The seller can delete the pickup request only before the <strong>FedEx Ready time</strong> set by him while creating the request. Once created, the pickup request can&#39;t be generated or edited again.</p>',97)])])}const u=t(s,[["render",a]]);export{c as __pageData,u as default};
